Communauto’s free carsharing app gives you access to close to 2,700 vehicles in 15 cities including Montreal, Toronto, Quebec City, Edmonton, Calgary, Hamilton, Kitchener-Waterloo, London, Halifax and Paris! Communauto offers round-trip, free-floating and one-way carsharing services. Rent a car at low cost for a few minutes, an hour, a day or longer... Gas (or electric charge!), insurance and maintenance are always included!

With the official Communauto app, you can :
-	Locate cars available nearby; 
-	Reserve or block a vehicle;
-       Lock and unlock the car;
-	Obtain key information on vehicles, including model, number, localization;
-	Identify the free-floating Service Area;
-	See upcoming, passed or canceled reservations;
-	Modify, extend or cancel a reservation;
-	Update your member profile;
-      Geolocalize your current reservation;
-	See the cost of your trips instantly and the duration of your current trip ;
-       Find the current FLEX location of a previously booked car if you need to book it again       to get a forgotten item. 
-       Activate the credit card available in the glove compartment or submit your receipt to 
        be reimbursed (available in specific cities);
-      Allow you to park and release the car in parking meter spaces downtown (Montreal only).


Not a member yet? 
Download the application to discover our closest stations and go to www.communauto.com to join! Stay in touch by following us on Facebook and Twitter.
